import React, { Component } from 'react'
import Heading from '../shared/heading';
import styled from 'styled-components';
import PortfolioCard from './portfolioCard';
import FullWidthDiv from '../shared/fullWidthDiv';
import Gap from '../shared/gap';



import {Column, Row} from '../shared/grid';



 class index extends Component {
     constructor(props){
         super(props);
         this.state = {
             data :[
                 {
                     id: 1,
                     title: '',
                     logo: '',
                     bigImage: '',
                     url: 'https://saroj85.github.io/SarojProfile/img/portfolio/flypur.png',
                     description: ''
                 },
                
             ]
             
             
         }
     }



    render() {
        return (
            <div>
               <FullWidthDiv>
               <Heading title="Portfolio" color="#2c3e50" />
               <Gap h="30px" />
                <Row>
                    <Column sm="4"><PortfolioCard url="../../"  /></Column>
                    <Column sm="4"><PortfolioCard url="../../"  /></Column>
                    <Column sm="4"><PortfolioCard url="../../"  /></Column>
                </Row>

               </FullWidthDiv>
                
                
            </div>
        )
    }
}


export default index;
